import React from "react";
import "./navbar.css";
import { Link } from "react-router-dom";

export default function Navbar() {
    return (
        <div className="navbar">
            <Link className="active" to="/">
                <a className="active">Home</a>
            </Link>

            <Link to="/artist">
                <a> Artist </a>
            </Link>
        </div>
    );
}
